"use strict";

const gcd = (a, b) => b === 0 ? a : gcd(b, a % b);

const f_gold = (points) => {
    const n = points.length;
    if (n < 3) return n;
    let res = 0;
    for (let i = 0; i < n - 1; i++) {
        const counter = {};
        let t_max = 0, duplicate = 0;
        for (let j = i + 1; j < n; j++) {
            const delta_x = points[i][0] - points[j][0];
            const delta_y = points[i][1] - points[j][1];
            if (delta_x === 0 && delta_y === 0) {
                duplicate += 1;
                continue;
            }
            const g = gcd(delta_x, delta_y);
            const d_x = delta_x / g;
            const d_y = delta_y / g;
            const key = `${d_x}.${d_y}`;
            counter[key] = (counter[key] || 0) + 1;
            t_max = Math.max(t_max, counter[key]);
        }
        res = Math.max(res, t_max + duplicate + 1);
    }
    return res;
};
